import React, { useRef, useState } from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faStarHalfStroke,
  faArrowRight,
  faArrowLeft,
  faLocationDot,
  faStar as filledStar,
  faChevronLeft,
  faClock,
  faPhone,
  faGlobe,
  faChevronDown,
} from "@fortawesome/free-solid-svg-icons";
import { faStar as emptyStar } from "@fortawesome/free-regular-svg-icons";

import img1 from "./img/jpg1.jpg";
import img2 from "./img/jpg2.jpg";
import img3 from "./img/jpg3.jpg";
export default function SpotDetail({ placeDetails }) {
  const starRating = (rating) => {
    const stars = [];

    for (let i = 1; i <= 5; i++) {
      if (rating >= i) {
        stars.push(<FontAwesomeIcon key={i} icon={filledStar} />);
      } else if (rating >= i - 0.5) {
        stars.push(<FontAwesomeIcon key={i} icon={faStarHalfStroke} />);
      } else {
        stars.push(<FontAwesomeIcon key={i} icon={emptyStar} />);
      }
    }

    return stars;
  };

  const [imgMargin, setImgMargin] = useState(0);

  const nextImg = (direction) => {
    if (direction === "right") {
      if (imgMargin > 100) return;
      setImgMargin((imgMargin) => {
        return imgMargin + 100;
      });
    }
    if (direction === "left") {
      if (imgMargin === 0) return;
      setImgMargin((imgMargin) => {
        return imgMargin - 100;
      });
    }
  };

  return (
    <div className="spot-detail">
      <div className="spot-detail-wrapper">
        <div className="spot-detail-carousel">
          <div
            className="spot-detail-img"
            style={{
              backgroundImage: `url(${img1})`,
              marginLeft: `-${imgMargin}%`,
            }}
          ></div>
          <div
            className="spot-detail-img"
            style={{
              backgroundImage: `url(${img2})`,
              marginLeft: `-${imgMargin}%`,
            }}
          ></div>
          <div
            className="spot-detail-img"
            style={{
              backgroundImage: `url(${img3})`,
              marginLeft: `-${imgMargin}%`,
            }}
          ></div>
        </div>
        <div className="spot-detail-img-btn spot-detail-btn">
          <FontAwesomeIcon icon={faChevronLeft} />
        </div>
        <div className="spot-detail-controlls">
          <div
            className={`spot-detail-btn ${imgMargin === 0 ? "disabled" : ""}`}
            onClick={() => nextImg("left")}
          >
            <FontAwesomeIcon icon={faArrowLeft} />
          </div>
          <div
            className={`spot-detail-btn ${imgMargin > 100 ? "disabled" : ""}`}
            onClick={() => nextImg("right")}
          >
            <FontAwesomeIcon icon={faArrowRight} />
          </div>
        </div>
      </div>
      <div className="padding-container">
        <h2 className="spot-detail-name">Domowe Obiadki</h2>
        <div>4.4 {starRating(4.4)} (230)</div>
      </div>

      <div className="spot-detail-info">
        <div className="spot-detail-info-el">
          <div className="icon">
            <FontAwesomeIcon icon={faLocationDot} />
          </div>
          <p>Fabryczna 18, Pietrzykowice, Fabryczna 18, Pietrzykowice</p>
        </div>
        <div className="spot-detail-info-el">
          <div className="icon">
            <FontAwesomeIcon icon={faClock} />
          </div>
          <p>
            <span className="map-result-open">Open</span> ⋅ Opens 11 AM
            <FontAwesomeIcon icon={faChevronDown} className="downArrow" />
          </p>
        </div>
        <div className="spot-detail-info-el opening-hours">
          Tuesday 11 AM-3 PM
        </div>
        <div className="spot-detail-info-el opening-hours"></div>
        <div className="spot-detail-info-el opening-hours"></div>
        <div className="spot-detail-info-el opening-hours"></div>
        <div className="spot-detail-info-el opening-hours"></div>
        <div className="spot-detail-info-el opening-hours"></div>
        <div className="spot-detail-info-el opening-hours"></div>

        <div className="spot-detail-info-el">
          <div className="icon">
            <FontAwesomeIcon icon={faGlobe} />
          </div>
          <p>facebook.com</p>
        </div>
        <div className="spot-detail-info-el">
          <div className="icon">
            <FontAwesomeIcon icon={faPhone} />
          </div>
          <p>+48 661 180 596</p>
        </div>
      </div>

      <div className="spot-detail-reviews">
        <h2 className="spot-detail-name">Reviews</h2>
        <div className="spot-detail-review-el">
          <div className="review-header">
            <img
              src={
                "https://lh3.googleusercontent.com/a-/ALV-UjXpf5XnfdKpFXImsgt1IAJdjvp4p8gxPNIkoxn-DdS3Gd6sLLtM=s128-c0x00000000-cc-rp-mo-ba2"
              }
              alt="user"
            />

            <span>Christian Arm</span>
          </div>
          <div className="review-stars">
            <div>{starRating(5)}</div>
            <div className="review-date">5 years ago</div>
          </div>
